import React from "react";
import styled from "styled-components";
import { NavLink } from "react-router-dom";
import { Routes, Route } from "react-router-dom";

function Navbar() {
  return (
    <Container>
      <NavLink to="/" className="brand-name">
        <ApexTitle>APEX</ApexTitle>_typer
      </NavLink>
      <Routes>
        <Route
          exact
          path="/"
          element={
            <NavLink to="/settings">
              <SettingsIcon className="icons" src="icons/settings.png" />
            </NavLink>
          }
        />
        <Route
          exact
          path="/settings"
          element={
            <NavLink to="/">
              <CloseIcon className="icons" src="icons/close.png" />
            </NavLink>
          }
        />
      </Routes>
    </Container>
  );
}

export default Navbar;

const Container = styled.div`
  width: 100%;
  padding: 20px 0;
  display: flex;
  justify-content: space-between;
  /* align-items: center; */
  .brand-name {
    font-size: 2em;
  }
  @media (max-width: 430px) {
    .brand-name {
      font-size: 1.5em;
    }
    .icons {
      margin-top: 10px;
      width: 18px;
      height: 18px;
    }
  }
  @media (max-width: 325px) {
    .brand-name {
      font-size: 1em;
    }
    .icons {
      width: 16px;
      height: 16px;
    }
  }
`;

const ApexTitle = styled.span`
  color: #00ffff;
`;

const SettingsIcon = styled.img`
  width: 22px;
  height: 22px;
  margin-top: 20px;
  filter: invert(88%) sepia(30%) saturate(4723%) hue-rotate(123deg)
    brightness(107%) contrast(100%);
`;

const CloseIcon = styled(SettingsIcon)``;
